var require = context.global.get('require');
var app=msg.app;

var bodyParser = require('body-parser');
var cookieParser = require('cookie-parser');
var session = require('express-session');

var __dirname = "/interplay_v2/public/private";
var USER_NAME = "admin";
var PASS_WORD = "Test123$";

// initialize body-parser to parse incoming parameters requests to req.body
app.use(bodyParser.urlencoded({ extended: true }));

// initialize cookie-parser to allow us access the cookies stored in the browser. 
app.use(cookieParser());

// initialize express-session to allow us track the logged-in user across sessions.
app.use(session({
    key: 'user_sid',
    secret: 'ThisIsaHighlySecretStuff',
    resave: false,
    saveUninitialized: false,
    cookie: {
        expires: 600000
    }
}));


// This middleware will check if user's cookie is still saved in browser and user is not set, then automatically log the user out.
// This usually happens when you stop your express server after login, your cookie still remains saved in the browser.
app.use((req, res, next) => {
    if (req.cookies.user_sid && !req.session.user) {
        res.clearCookie('user_sid');        
    }
    if(req.url.indexOf('/demo') != -1) {
        if (!req.session.user || !req.cookies.user_sid) {
            if(req.url.indexOf('/demo/login') == -1) {
                return res.redirect('/demo/login');
            }
        }
    }
    next();
});


// middleware function to check for logged-in users
var sessionChecker = (req, res, next) => {
    if (req.session.user && req.cookies.user_sid) {
        res.redirect('/demo/dashboard');
    } else {
        next();
    }    
};


// route for Home-Page
app.get('/demo/', sessionChecker, (req, res) => {
    res.redirect('/demo/login');
});

// route for user Login
app.route('/demo/login')
    .get(sessionChecker, (req, res) => {
        //res.sendFile(__dirname + '/demo/login.html');
        res.redirect('/login');
    })
    .post((req, res) => {
        node.warn(req);
        try{
            var username = req.body.username,
                password = req.body.password;

            if((username != USER_NAME) || (password != PASS_WORD)) {
                res.redirect('/demo/login');
            } else {
                req.session.user = username;
                res.redirect('/demo/dashboard');
            }
        }catch(e) {
            res.redirect('/demo/login');
        }
    });


// route for user's dashboard
app.get('/demo/dashboard', (req, res) => {
    if (req.session.user && req.cookies.user_sid) {
        res.redirect('/demo/app');
    } else {
        res.redirect('/demo/login');
    }
});


// route for user logout
app.get('/demo/logout', (req, res) => {
    if (req.session.user && req.cookies.user_sid) {
        res.clearCookie('user_sid');
        res.redirect('/demo/');
    } else {
        res.redirect('/demo/login');
    }
});

